import React, { Component } from 'react'
import './css/login.less'
// import bg from './img/bg.webp'
import logo from './img/dora_17.png'
export default class Login extends Component {
    render() {
        return (
            <div className="login">
                <header>
                    <img src={logo} alt="logo" />
                    <h1>商品管理系统</h1>

                </header>

                <section>
                    <h1>用户登录</h1>


                </section>
            </div>
        )
    }
}
